import React from 'react';
import { Typography, Button, ButtonGroup, Container } from '@mui/material';
import AcUnitOutlinedIcon from '@mui/icons-material/AcUnitOutlined';
import SendIcon from '@mui/icons-material/Send';
import KeyboardArrowRightIcon from '@mui/icons-material/KeyboardArrowRight';
import { styled } from '@mui/material/styles';

// Create a custom styled Button component
const CustomButton = styled(Button)({
  fontSize: 60,
  color: "white",
  backgroundColor: "violet" ,
  "&:hover": {
    backgroundColor: "blue"
  },
  title:{
    TextDecoderation: "underline",
    maginBotton: 20,
  }
});

export default function Create() {
  return (
    <Container>
      <Typography 
      className= {ClassNames.title}
      variant="h6" color="textSecondary" component="h2" gutterBottom>
        Create a new Note
      </Typography>
      <br /> <br />

      <Button type="submit" color="primary">
        Submit
      </Button>
      <Button type="submit" color="secondary" variant="outlined">
        Submit
      </Button>

      <br />
      <br />
      <ButtonGroup color="secondary" variant="contained">
        <Button>One</Button>
        <Button>Two</Button>
        <Button>Three</Button>
      </ButtonGroup>
      <br />
      <br />

      <Button
        onClick={() => console.log('you click me')}
        type="submit"
        color="info"
        variant="contained"
      >
        Submit
      </Button>

      {/* icons */}
      <br />
      <br />
      <AcUnitOutlinedIcon />
      <AcUnitOutlinedIcon color="error" fontSize="large" />
      <AcUnitOutlinedIcon color="info" fontSize="small" />
      <br />
      <br />
      {/* Add icon to button */}
      <CustomButton
        type="submit"
        color="secondary"
        variant="outlined"
        startIcon={<SendIcon />} // left size
        endIcon={<KeyboardArrowRightIcon />} // right size
      >
        Submit
      </CustomButton>
    </Container>
  );
}
